
<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1.0"/>
  <title>AetherSwap TapBot</title>
  <style>
    html, body {
      margin: 0;
      padding: 0;
      height: 100%;
      overflow: hidden;
      font-family: 'Segoe UI', sans-serif;
      background: radial-gradient(circle at center, #0e1124 0%, #070a18 100%);
      color: #ffffff;
    }

    #intro {
      position: absolute;
      top: 0;
      left: 0;
      right: 0;
      bottom: 0;
      background: #000;
      display: flex;
      align-items: center;
      justify-content: center;
      flex-direction: column;
      z-index: 10;
      animation: fadeOut 2s ease-in-out 3s forwards;
    }

    #intro h1 {
      font-size: 2rem;
      margin: 0;
      color: #00d9ff;
    }

    #intro p {
      font-size: 1rem;
      color: #ccc;
    }

    @keyframes fadeOut {
      to { opacity: 0; visibility: hidden; }
    }

    header {
      height: 60px;
      display: flex;
      justify-content: space-between;
      align-items: center;
      padding: 0 1.2rem;
      background: rgba(0,0,0,0.5);
    }

    .balance {
      color: #00d9ff;
      font-weight: bold;
    }

    .game-area {
      position: relative;
      height: calc(100vh - 120px);
      display: flex;
      flex-direction: column;
      align-items: center;
      justify-content: center;
    }

    #counter {
      font-size: 2.4rem;
      font-weight: bold;
      margin-bottom: 1.5rem;
      color: #ffd700;
      text-shadow: 0 0 8px #000;
    }

    #tap-zone {
      position: relative;
    }

      background-size: contain;
      background-repeat: no-repeat;
      background-position: center;
      border-radius: 50%;
      border: 6px solid #00d9ff;
      box-shadow: 0 0 50px #00d9ff, inset 0 0 15px #00ffaa;
      cursor: pointer;
      transition: transform 0.1s;
    }

    #tap-character:active {
      transform: scale(0.94);
    }

    .tap-pop {
      position: absolute;
      color: #00ffaa;
      font-size: 1.2rem;
      font-weight: bold;
      animation: floatUp 1s ease-out forwards;
      pointer-events: none;
    }

    @keyframes floatUp {
      0% { opacity: 1; transform: translateY(0); }
      100% { opacity: 0; transform: translateY(-60px); }
    }

    nav {
      height: 60px;
      background: rgba(0,0,0,0.4);
      display: flex;
      justify-content: space-around;
      align-items: center;
      font-size: 1rem;
      position: fixed;
      width: 100%;
      bottom: 0;
      left: 0;
    }

    nav button {
      background: none;
      border: none;
      color: #ffffff;
      font-weight: bold;
      cursor: pointer;
    }

    nav button.active {
      color: #00d9ff;
    }
  </style>
</head>
<body>

<div id="intro">
  <h1>Activating Aether Core...</h1>
  <p>Decrypting smart contract...</p>
</div>

<header>
  <div id="username">@User</div>
  <div class="balance" id="balance">AETH: 0</div>
</header>

<div class="game-area" id="home-screen">
  <div id="counter">0 AETH</div>
  <div id="tap-zone">
    <div id="tap-character" onclick="handleTap(event)"></div>
  </div>
</div>

<nav>
  <button class="active">Home</button>
  <button>Shop</button>
  <button>Missions</button>
  <button>Referrals</button>
</nav>

<script>
  const tg = window.Telegram?.WebApp;
  const user = tg?.initDataUnsafe?.user;
  document.getElementById("username").textContent = user?.username ? "@" + user.username : "@Anonymous";

  let aeth = Number(localStorage.getItem("aeth") || 0);
  let taps = Number(localStorage.getItem("taps") || 0);

  function updateUI() {
    document.getElementById("counter").textContent = aeth + " AETH";
    document.getElementById("balance").textContent = "AETH: " + aeth;
  }

  function handleTap(e) {
    aeth += 1;
    taps += 1;
    localStorage.setItem("aeth", aeth);
    localStorage.setItem("taps", taps);
    updateUI();
    spawnPop();
  }

  function spawnPop() {
    const pop = document.createElement("div");
    pop.className = "tap-pop";
    pop.style.left = Math.random() * 100 + "px";
    pop.innerText = "+1";
    document.getElementById("tap-zone").appendChild(pop);
    setTimeout(() => pop.remove(), 1000);
  }

  updateUI();
</script>

</body>
</html>
